<!doctype html>
<html lang="de">
<head>
<meta charset="utf-8"/>
<meta name="theme-color" content="#0b0e1a"/>
<meta name="apple-mobile-web-app-capable" content="yes"/>
<meta name="apple-mobile-web-app-status-bar-style" content="black-translucent"/>
<meta name="mobile-web-app-capable" content="yes"/>
<meta name="viewport" content="width=device-width,initial-scale=1,viewport-fit=cover"/>
<title>Akademische Bierprobe 2027</title>
<link href="https://fonts.googleapis.com/css2?family=Bebas+Neue&family=Special+Elite&family=Oswald:wght@400;600&display=swap" rel="stylesheet">
<style>

:root{
  --night:#0b0e1a; --navy:#111827; --navy2:#1c2540;
  --amber:#e8a020; --amber2:#c47c08; --amber3:#f5c842;
  --white:#f0ece0; --muted:#8a8070; --ink:#07090f;
  --green:#1a4a28; --red:#7a1a1a; --paper:#1e2235;
}
*{box-sizing:border-box;margin:0;padding:0;}
html,body{
  height:100%;
  overflow:hidden;
  background:var(--night);
  position:fixed;
  width:100%;
  overscroll-behavior:none;
  -webkit-overflow-scrolling:touch;
}
body{font-family:'Special Elite',serif;color:var(--white);}

/* Noise */
body::before{
  content:'';position:fixed;inset:0;pointer-events:none;z-index:999;
  background-image:url("data:image/svg+xml,%3Csvg viewBox='0 0 256 256' xmlns='http://www.w3.org/2000/svg'%3E%3Cfilter id='n'%3E%3CfeTurbulence type='fractalNoise' baseFrequency='0.9' numOctaves='4' stitchTiles='stitch'/%3E%3C/filter%3E%3Crect width='100%25' height='100%25' filter='url(%23n)' opacity='0.06'/%3E%3C/svg%3E");
}

/* Radiale Vignette */
body::after{
  content:'';position:fixed;inset:0;pointer-events:none;z-index:998;
  background:radial-gradient(ellipse at 50% 50%, transparent 40%, rgba(7,9,15,.75) 100%);
}

.screen{
  position:fixed;
  top:0;left:0;right:0;bottom:0;
  display:flex;flex-direction:column;
  align-items:center;justify-content:center;
  padding-top:env(safe-area-inset-top);
  padding-bottom:env(safe-area-inset-bottom);
}

/* ═══ SPLASH SCREEN ═══════════════════════════════════════ */
#splash{
  background:var(--night);
  z-index:10;
}

.splash-inner{
  position:relative;
  width:100%;
  max-width:460px;
  height:100vh;
  display:flex;
  flex-direction:column;
  align-items:center;
  justify-content:flex-end;
  padding-bottom:max(16px,2.5vh);
}

/* Bild: nimmt obere ~60% ein */
.splash-img{
  position:absolute;
  top:-2vh;left:50%;
  transform:translateX(-50%);
  width:min(380px,95vw);
  /* weicher Übergang nach unten */
  -webkit-mask-image:linear-gradient(to bottom, black 60%, transparent 95%);
  mask-image:linear-gradient(to bottom, black 60%, transparent 95%);
  animation:imgDrop 700ms cubic-bezier(.36,2,.5,.9) 300ms both;
}
.splash-img img{width:100%;display:block;}
@keyframes imgDrop{
  from{opacity:0;transform:translateX(-50%) scale(.92) translateY(-18px);}
  to  {opacity:1;transform:translateX(-50%) scale(1) translateY(0);}
}

/* App-Titel im Zwischenraum */
.app-header{
  position:relative;
  width:100%;
  text-align:center;
  z-index:20;
  animation:fadeIn 500ms ease 800ms both;
  margin-bottom:4px;
}
.app-sup{
  font-family:'Bebas Neue',cursive;
  font-size:clamp(9px,2vw,11px);
  letter-spacing:5px;
  color:var(--amber);
  opacity:.8;
  margin-bottom:3px;
}
.app-title{
  font-family:'Bebas Neue',cursive;
  font-size:clamp(22px,6vw,36px);
  letter-spacing:3px;
  line-height:.95;
  color:var(--white);
  text-shadow:0 0 40px rgba(232,160,32,.3), 3px 3px 0 rgba(0,0,0,.5);
}
.app-year{
  font-family:'Bebas Neue',cursive;
  font-size:clamp(14px,4vw,22px);
  letter-spacing:6px;
  color:var(--amber);
  text-shadow:0 0 20px rgba(232,160,32,.4);
}

/* Sprechblase */
.bubble-wrap{
  position:absolute;
  /* sitzt rechts neben dem Kopf, ca 40% von oben */
  top:clamp(130px, 30vh, 260px);
  right:max(8px,2vw);
  width:min(200px, 44vw);
  animation:bubblePop 400ms cubic-bezier(.36,2.2,.5,.8) 1000ms both;
  z-index:20;
}
@keyframes bubblePop{
  from{opacity:0;transform:scale(.4) rotate(4deg);}
  to  {opacity:1;transform:scale(1) rotate(1.5deg);}
}
.bubble{
  background:var(--white);
  border:2.5px solid var(--ink);
  border-radius:14px 18px 18px 12px;
  padding:11px 14px;
  box-shadow:3px 3px 0 var(--ink);
  transform:rotate(1.5deg);
  position:relative;
}
/* Schweif zeigt nach links-unten (Richtung Mund) */
.bubble::after{
  content:'';position:absolute;
  left:-18px;bottom:14px;
  width:0;height:0;
  border-top:10px solid transparent;
  border-bottom:10px solid transparent;
  border-right:20px solid var(--ink);
}
.bubble::before{
  content:'';position:absolute;
  left:-12px;bottom:16px;
  width:0;height:0;
  border-top:8px solid transparent;
  border-bottom:8px solid transparent;
  border-right:15px solid var(--white);
  z-index:1;
}
.bubble .q{
  font-family:'Special Elite',serif;
  font-size:clamp(11px,2.8vw,13px);
  line-height:1.4;
  color:var(--ink);
  font-style:italic;
}
.bubble .attr{
  margin-top:5px;
  font-size:10px;
  color:#666;
  font-family:'Oswald',sans-serif;
  letter-spacing:.5px;
}

/* Unterer Bereich: Rolle wählen + Button */
.bottom{
  width:100%;
  max-width:400px;
  display:flex;
  flex-direction:column;
  align-items:center;
  gap:12px;
  position:relative;
  z-index:20;
  animation:fadeIn 400ms ease 1400ms both;
}
@keyframes fadeIn{from{opacity:0;transform:translateY(8px);}to{opacity:1;transform:none;}}

.role-row{
  display:flex;
  gap:10px;
  width:100%;
  padding:0 16px;
}
.role-btn{
  flex:1;
  background:var(--paper);
  border:2px solid rgba(255,255,255,.12);
  border-radius:6px;
  padding:16px 10px;
  text-align:center;
  cursor:pointer;
  font-family:'Bebas Neue',cursive;
  color:var(--white);
  letter-spacing:1px;
  font-size:clamp(16px,4vw,20px);
  box-shadow:0 4px 16px rgba(0,0,0,.4);
  transition:border-color .15s, background .15s;
  position:relative;
  min-height:80px;
  -webkit-tap-highlight-color:transparent;
  touch-action:manipulation;
  user-select:none;
  -webkit-user-select:none;
}
.role-btn::before{
  content:'';position:absolute;
  left:0;top:0;bottom:0;width:3px;
  border-radius:6px 0 0 6px;
  background:var(--amber);
}
.role-btn:active{transform:scale(.97);}
.role-btn .ico{font-size:26px;display:block;margin-bottom:4px;}
.role-btn .lbl{display:block;}
.role-btn .sub{font-family:'Special Elite',serif;font-size:10px;color:var(--muted);letter-spacing:0;margin-top:2px;display:block;}
.role-btn.host{border-color:rgba(232,160,32,.3);}
.role-btn.host::before{background:var(--amber);}

/* Trennlinie mit Text */
.divider{
  display:flex;align-items:center;gap:10px;
  width:calc(100% - 32px);
}
.divider::before,.divider::after{
  content:'';flex:1;height:1px;background:rgba(255,255,255,.08);
}
.divider span{
  font-family:'Bebas Neue',cursive;font-size:11px;
  letter-spacing:3px;color:var(--muted);
}



/* ═══ VIDEO INTRO ════════════════════════════════════════ */
#intro-screen{
  position:fixed;
  top:0;left:0;right:0;bottom:0;
  background:#000;
  z-index:500;
  display:flex;align-items:center;justify-content:center;
  cursor:pointer;
  /* iOS safe area */
  padding-top:env(safe-area-inset-top);
  padding-bottom:env(safe-area-inset-bottom);
  -webkit-tap-highlight-color:transparent;
}
#intro-screen.hidden{
  animation:fadeOut 600ms ease forwards;
  pointer-events:none;
}
@keyframes fadeOut{
  from{opacity:1;}
  to  {opacity:0;visibility:hidden;}
}
#intro-video{
  width:100%;
  height:100%;
  max-width:100vw;
  max-height:100vh;
  object-fit:contain;
  display:block;
  /* Prevent iOS double-tap zoom */
  touch-action:manipulation;
}
/* Skip-Button */
#skip-btn{
  position:absolute;
  bottom:max(20px,4vh);
  right:max(20px,4vw);
  background:rgba(0,0,0,.55);
  border:1.5px solid rgba(255,255,255,.25);
  border-radius:4px;
  color:rgba(255,255,255,.7);
  font-family:'Bebas Neue',cursive;
  font-size:15px;
  letter-spacing:2px;
  padding:8px 18px;
  cursor:pointer;
  backdrop-filter:blur(4px);
  transition:opacity .2s;
}
#skip-btn:hover{opacity:1;border-color:rgba(255,255,255,.5);}
</style>
</head>

<script>
function startVideo(){
  const overlay = document.getElementById('tap-overlay');
  const v = document.getElementById('intro-video');

  // Overlay sofort weg
  if(overlay) overlay.remove();

  // Sicherstellen dass Video von vorne startet
  v.currentTime = 0;
  v.muted = false;
  v.volume = 1.0;

  // iOS: Video muss explizit geladen sein vor play()
  v.load();

  // Kurze Verzögerung damit load() greift, dann play()
  setTimeout(()=>{
    const p = v.play();
    if(p !== undefined){
      p.then(()=>{
        // Läuft — alles gut
      }).catch((err)=>{
        console.log('play failed:', err);
        // Letzter Fallback: muted
        v.muted = true;
        v.play().catch(()=>skipIntro());
      });
    }
  }, 80);
}

function skipIntro(){
  const s = document.getElementById('intro-screen');
  s.classList.add('hidden');
  setTimeout(()=>s.remove(), 650);
}

const vid = document.getElementById('intro-video');

// Wenn Video zu Ende → automatisch zum Splash
vid.addEventListener('ended', skipIntro);

// Fallback: falls Autoplay blockiert → sofort Splash zeigen
vid.addEventListener('error', skipIntro);
setTimeout(()=>{
  // Falls nach 15s noch nix passiert ist
  if(document.getElementById('intro-screen')){
    skipIntro();
  }
}, 15000);
</script>
